function countCharacters(words: string[], chars: string) {
  let length = 0;

  for(let i = 0; i < words.length; i++) {
    const word = words[i];
    if(word.length > chars.length) continue;

    let result = true;
    const cache: Record<string, number> = {};
    for(let j = 0; j < word.length; j++) {
      const char = word[j];
      const ind = chars.indexOf(char, typeof cache[char] === "number" ? cache[char] + 1 : 0);
      result = ind > -1;
      if(!result) break;
      
      cache[char] = ind;
    }

    if(result) length += word.length;
  }

  return length;
}

